//Create Namespace to hold all variables and methods.
var siteBuild = {};

siteBuild.initFlickity = function () {

  var slides = $('.carousel-cell');

  var flickity = $('.carousel').flickity({
    // options
    cellAlign: 'left',
    contain: true,
    accessibility: true,
    prevNextButtons: true,
    pageDots: true,
    arrowShape: {
      x0: 10,
      x1: 60,
      y1: 50,
      x2: 60,
      y2: 45,
      x3: 15
    }
  });

};

siteBuild.userEvents = function () {

};

siteBuild.userNavigation = function () {
  
}

//Initializing all Code within one INIT Function
siteBuild.init = function () {
  //All functions etc needed for Site.
  siteBuild.initFlickity();
  // siteBuild.userEvents();
  // siteBuild.userNavigation();
  // window.initFlickity();
};

//Initializing the JS for the Website Inside the Document Ready - Calling the INIT Function
$(document).ready(function () {
  siteBuild.init();
  $(document).foundation();
});

